import logo from './logo.svg';
import './App.css';

let name = '';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        Hello world
        <Demo> </Demo>
      </header>
    </div>
  );
}

function Demo() {
  return (
    <div className="App">
      <header className="App-header">
        Demo componant
      </header>
    </div>
  );
}

export default App;
